    '<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph {\"align\":\"center\",\"fontSize\":\"medium\"} -->\n<p class=\"has-text-align-center has-medium-font-size\">Pacific Mainstream Jazz Band</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"align\":\"center\",\"id\":76,\"width\":350,\"height\":150,\"sizeSlug\":\"full\",\"linkDestination\":\"custom\"} -->\n<div class=\"wp-block-image\"><figure class=\"aligncenter size-full is-resized\"><a href=\"http://localhost/jazztownsville/pacific-mainstream-jazz/\"><img src=\"http://localhost/jazztownsville/wp-content/uploads/2022/05/wpffeaf23f_05_06.jpg\" alt=\"\" class=\"wp-image-76\" width=\"350\" height=\"150\"/></a></figure></div>\n<!-- /wp:image --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph {\"align\":\"center\",\"fontSize\":\"medium\"} -->\n<p class=\"has-text-align-center has-medium-font-size\">Stokes Nicholson Big Band</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"align\":\"center\",\"id\":73,\"width\":350,\"height\":150,\"sizeSlug\":\"full\",\"linkDestination\":\"custom\"} -->\n<div class=\"wp-block-image\"><figure class=\"aligncenter size-full is-resized\"><a href=\"http://localhost/jazztownsville/stoke-nicholson-big/\"><img src=\"http://localhost/jazztownsville/wp-content/uploads/2022/05/wp2ed00b5a_05_06.jpg\" alt=\"\" class=\"wp-image-73\" width=\"350\" height=\"150\"/></a></figure></div>\n<!-- /wp:image --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column {\"width\":\"25%\"} -->\n<div class=\"wp-block-column\" style=\"flex-basis:25%\"></div>\n<!-- /wp:column -->\n\n<!-- wp:column {\"width\":\"50%\"} -->\n<div class=\"wp-block-column\" style=\"flex-basis:50%\"><!-- wp:paragraph {\"align\":\"center\",\"fontSize\":\"medium\"} -->\n<p class=\"has-text-align-center has-medium-font-size\">Type A Personality Jazz ensem