    '2022-05-01 03:15:58',
    '<!-- wp:paragraph -->\n<p><em>Type A Personality Jazz&nbsp;describes a musical ensemble comprised of confident band leaders with big personalities (no one here mentioned egos did they?). &nbsp;</em></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The original group consisted of Larry Thomson on keyboard, Les Nicholson on trumpet, Bob Passmore on bass, Justin Cataldo on drums, David Salisbury on sax and vocalist Vicki Salisbury. &nbsp;Each of these players heads up their own musical group from Cataldo\'s&nbsp;<em>The Kitchen</em>&nbsp;to the&nbsp;<em>Stokes Nicholson Big Band</em>&nbsp;founded by Les; &nbsp;Vicki and the Captain in&nbsp;<em>Captain Nemo</em>&nbsp;and Bob\'s&nbsp;<em>Counterpoint</em>,&nbsp;<em>Magnetic Views</em>&nbsp;for Larry as well as the various other bands many of us have been involved with. &nbsp;Obviously the A-Type brand was the perfect fit for this crew! &nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The group was formed in 2011 and has performed at the Townsville Jazz Club, Magnetic Island\'s Tropical Jazz Party, Townsville JazzFest, the Jezzine Barracks launch and various gigs here and there.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The composition of&nbsp;<em>Type A Personality Jazz</em>&nbsp;changes with availability of players, however what does not change is the ethos the group was founded on, &nbsp;our mutual passion for jazz and loving the spotlight.</p>\n<!-- /wp:paragraph -->',
