lign\":\"center\",\"backgroundColor\":\"teal\"} -->\n<p class=\"has-text-align-center has-teal-background-color has-background\"><strong>JUNIOR JAMMERS &nbsp;Lounde Bar Sugar Shaker 6 PM till 9 PM</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:table {\"backgroundColor\":\"teal\"} -->\n<figure class=\"wp-block-table\"><table class=\"has-teal-background-color has-background\"><tbody><tr><td class=\"has-text-align-center\" data-align=\"center\"><strong>6<sup>th</sup> May</strong></td><td class=\"has-text-align-center\" data-align=\"center\"><strong>Clare Whitcombe trio</strong></td></tr><tr><td class=\"has-text-align-center\" data-align=\"center\"><strong>13<sup>th</sup> May</strong></td><td class=\"has-text-align-center\" data-align=\"center\"><strong>Jim Bannona trio</strong></td></tr></tbody></table></figure>\n<!-- /wp:table --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns --></div>\n<!-- /wp:group -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph {\"align\":\"center\",\"backgroundColor\":\"teal\"} -->\n<p class=\"has-text-align-center has-teal-background-color has-background\"><strong><strong><strong>22<sup>th</sup> May 5 PM till 8 PM Love 4 Swing (Andrew Dajski Quintet)</strong></strong></strong></p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph {\"align\":\"center\",\"backgroundColor\":\"teal\"} -->\n<p class=\"has-text-align-center has-teal-background-color has-background\"><strong><strong>29<sup>th</sup> May 5 PM till 8PM Doug Lye 80th Birthday Bash</strong></strong></p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:heading {\"textAlign\":\"center\",\"level\":3} -->\n<h3 class=\"has-text-align-center\">Compeleted</h3>\n<!-- /wp:heading -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph {\"align\":\"center\",\"backgroundColor\":\"red\"} -->\n<p class=\"has-text-align-center has-red-background-color has-background\"><strong><strong>24<sup>th</sup> April 5PM till 8 PM Jeremy Hawker and the Juniors</strong></strong></p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph {\"align\":\"center\",\"backgroundColor\":\"red\"} -->\n<p class=\"has-text-align-center has-red-background-color has-background\"><strong>10<sup>th</sup> April 5PM till 8 PM&nbsp;Larry Thomson and friends</strong></p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph {\"align\":\"center\",\"backgroundColor\":\"red\"} -->\n<p class=\"has-text-align-center has-red-background-color has-background\"><strong>27<sup>th</sup> March 5PM till 8 PM Andrew Dajski and friends</strong></p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph {\"align\":\"center\",\"backgroundColor\":\"red\"} -->\n<p class=\"has-text-align-center has-red-background-color has-background\"><strong>13<sup>th</sup> March 5PM till 8 PM Roger Clarke and friends</strong></p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph {\"align\":\"center\",\"backgroundColor\":\"red\"} -->\n<p class=\"has-text-align-center has-red-background-color has-background\"><strong>27<sup>th</sup> February 5PM till 8 PM Sara Shaw will feature with the Steve Martin Quartet</strong></p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph {\"align\":\"center\",\"backgroundColor\":\"red\"} -->\n<p class=\"has-text-align-center has-red-background-color has-background\"><strong>13<sup>th</sup> February&nbsp;5PM till 8 PM Pacific Mainstream Jazz Band</strong></p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->',
