    '<!-- wp:paragraph -->\n<p>PMJB is to the best of our knowledge Queensland\'s longest running jazz band and was founded in February 1974.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Original members of the band were:<br>Jan Aleman  Guitar<br>Larry Thomson  Trombone<br>Paul Waters  Clarinet<br>Ivan Hauri  Clarinet<br>Luke Portier  Bass<br>Bob Hebden  Drums<br>Les Nicholson  Trumpet</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>In 1975 not long after starting John Ruffle and Nev Minon joined the band and Bob Passmore and Red Huxley joined around 1985.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>In 1978 PMJB recorded the first ever locally recorded and produced vinyl album engineered by Eric Ball. PMJB has recorded on ABC radio with Gospel singer Shereen Malamoo and in 1982 had its own three-show jazz series on Channel 7 Television titled&nbsp;<em>Front Line Jazz</em>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>PMJB has appeared at Festivals all over Queensland and appeared at the Australian Jazz Festival in</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>1978.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The band\'s music style supports its name and the music ranges from early Trad, to mainstream, to swing with a hint of modern.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The bands motto is take the music seriously but not yourself.<br><br>John, Nev, Red, Bob (Passmore) and Les are still in the band which plays on the 4th Sunday of each month as the house band for the Townsville Jazz Club.</p>\n<!-- /wp:paragraph -->',
