  (
    406,
    1,
    '2022-05-09 03:00:37',
    '2022-05-09 03:00:37',
    '<!-- wp:paragraph -->\n<p>TRB4 formed in early 2010. My old mate, Bob Passmore, suspected that Gavin Forno (bass guitar), Rebecca McHutchison (saxophone &amp; vocals), Mark Wyer (piano) and myself (drums) might sound good together. Our first gig confirmed the wisdom of Bobs discerning ears. We clicked right from the start. Wed thrown around all sorts of names for our ensemble and finally settled on TRB4, in time for the 2010 Palmer Street Jazz Festival.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We all play with many other groups and bring those experiences with us to TRB4. This synthesises into unique musical performances using all the colours on the palette as we collaborate for the greater good of the music.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Rebeccas smouldering ballads can stand the hair up on the back of your neck. Marks piano has a glorious elegance. His technical brilliance is balanced with spaciousness and nuance. Gavins bass can lure us into funkier territory. Theres always new ways to interpret the old standards. As well as foot stomping swing we like to explore playing softly and slowly, exploring the nuance of the song. We all particularly enjoy Latin rhythms. On brushes mallets or sticks, I play with both the lyric and the music in mind as I create a rhythmic framework under the other musicians. As American jazz drummer Shelly Manne once said: we never play a tune the same way once</p>\n<!-- /wp:paragraph -->',
    'The Reg Braun Four',
    '',
