    408,
    1,
    '2022-05-09 03:45:12',
    '2022-05-09 03:45:12',
    '<!-- wp:navigation {\"ref\":62,\"layout\":{\"type\":\"flex\",\"justifyContent\":\"center\"}} /-->\n\n<!-- wp:paragraph -->\n<p><strong>HARBOUR END JAZZ CLUB</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Whilst jazz music had been played in Townsville long before the Harbour End Jazz Club was formed in 1980, there had not been a recognised venue where jazz was performed for about twenty years. &nbsp;This club effectively started the revival of the jazz scene in Townsville which was then carried on with the formation of the North Queensland Jazz Club (NQ Jazz Club Inc. from 1995) and its subsequent change of name to Townsville Jazz Club Inc. in 2012.<br>The Harbour End Jazz Club was started in 1980 by Mo Murakami, Ted Redknap, Bob Hebden and Les Nicholson.<br>Ted and Mo were members of the widely acclaimed North Qld Area Army Band. &nbsp;The Army band had a close association with the local musicians and having Ted and Mo as Directors cemented that close relationship. &nbsp;Mo also had an input into starting the NQ Jazz Club which still exists today and is a significant institution in the promotion of jazz in Townsville. &nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The club met on every second Thursday at the then Tattersalls Hotel (Tatts) in a back room that was small but very intimate, the ideal jazz club. &nbsp;Crowds were phenomenal and there was not enough room to raise your arm to drink your beer. &nbsp;The room spilled out to a beer garden which thankfully provided some space. &nbsp;Brian Fitzimmons and his wife Pat ran Tatts and were very supportive of the club.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Brian and Pat also ran jazz in the beer garden on Saturday afternoons which provided work for the local bands. &nbsp;Great musos such as Billy Laut, Ross Collins, Kanga Yoman and Franz Condie were regulars. &nbsp;<br>All were ex Sydney musos who had come north to get away from the rat race.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Going to the jazz club at Tatts was always a great night. &nbsp;The club became a place to be on the social scene and many friendships were formed which have lasted for 30 plus years. &nbsp;Over its life the club had some famous Australian musicians who appeared including the Bob Barnard Jazz Band which included John Macarthy, Chris Tapperel, Johnny Costello, Len Barnard and Whally Wickham. &nbsp;Don Burrows also played at the club as did Nth Qld legends like Junior See Poy and his wife Ann and Paul Zammit.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The club ran for many years and held two major Jazz Festivals in 1981 and 1983. &nbsp;Sheila Keefe, a then Townsville City Council Alderman, was instrumental in assisting with the 1983 festival and was the patron of the club.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The Pacific Mainstream Jazz Band (PMJB) was the house band at the club which in those days had a line-up of Ivan Hauri (clarinet), Luke Portier (bass), John Ruffle (piano), Bob Hebden (drums), Nev Minon (trombone) and Les Nicholson (trumpet). &nbsp;Paul Waters on clarinet was also a member of PMJB at various stages.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>On the 23rd &nbsp;February 2014 PMJB celebrated its 40th birthday at the Townsville Jazz Club and at that time Les, Bob, John and Nev were still current band members.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The club folded in 1990 due to several factors, arguably the most significant being the demise of the Nth Qld Area Army Band. &nbsp;This decision by the Government of the time was very contentious and caused a vociferous outcry from members of the Townsville Community.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>For ten years the Harbour End Jazz Club was one of the in places in the Townsville music scene and made a great contribution to the Townsville Arts and Music Community.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong><br>NQ JAZZ CLUB INC.</strong>&nbsp;<br>The formation of the North Queensland Jazz Club began with discussions led by Brian Linforth, Mo Murakami and Andrew Dajski around 1993. &nbsp;By 1994 these guys were playing once a month for beer money just to get the club started however the club Newsletter from 1999 states that on Sunday 11th&nbsp;April the club celebrated its fourth birthday and indicates the official start of North Queensland Jazz Club being 7th&nbsp;April 1995. &nbsp;Bands appearing in this formative era included Andrews band&nbsp;<em>Downtown Dixie</em>, Nobby Nielsen from Cairns, Les Nicholsons&nbsp;<em>Pacific Mainstream Jazz Band</em>&nbsp;and other groups of musos who regularly played together in un-named bands<em>.</em>&nbsp;Brian Linforth was the inaugural President and the club became incorporated on the 22nd&nbsp;July 1997 and adopted the official name of NQ Jazz Club Inc.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The original logo for the NQ Jazz Club Inc. was designed and drawn by Bob Hebden and depicted a trumpet-playing, bowler-hatted face in the sun overlooking Castle Hill</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>In April 1998 three foundation members, Andrew Dajski, Brian Linforth and Mo Murakami (now deceased) were appointed as Life Members of the club.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>1998 was also the year that the NQ Jazz Club fully supported the decision by a small independent group, Les Nicholson, Bob Passmore, Peter Martin and Brian Lane (then president of the NQ Jazz Club), that the time was right to run an activity to encourage high school students to appreciate and play jazz. &nbsp;Whilst this was not a jazz club event Nth Qld Junior Jazz Festival Inc. was promoted through the NQ Jazz Club until the final festival was held in 2007 and the remaining funds were transferred to the NQ Jazz Club on the 25th&nbsp;June 2008. &nbsp;&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Like many other jazz clubs it was a struggle to find an appropriate venue and the first gig to gauge public interest was held in the Sovereign Hotel in Flinders Street. &nbsp;&nbsp;Over the next four years the clubs jazz nights were held in the Exchange Hotel, The Crown Hotel, the Royal Hotel, the Rugby League Club in Redpath Street and then the Kirwan Function Centre until September 1998.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The NQ Jazz Club then moved to its first ideal venue, the German Australian Club in Aitken Street, Aitkenvale on 25th&nbsp;October 1998 where it stayed until the building was put on the market December 2008. &nbsp;The committee could not be assured of having secure accommodation for the full year so another venue had to be found. &nbsp;The club moved to its current location at the Townsville PCYC, Wellington Street, Aitkenvale for the start of the 2009 year.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The club would not have become established and continued to operate had it not been for many dedicated voluntary committee members who gave their time freely to help manage a successful jazz club. &nbsp;Whilst its not possible to name all committee members club records show the following people have filled the Presidents role since the first AGM in 1995:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>1995  1996 &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Brian Linforth</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>1997 &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Len Kingsun</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>1998  1999 &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Brian Lane</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>1999  2003 &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Neil Walsh</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>2003 &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Neil Walsh / Acting President Bob Spillane</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>2004  2006 &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Bob Spillane</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>2007 &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Bob Spillane / Acting Presidents Brian Lane &amp; Ken Burnes</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>2008  2009 &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Ken Burnes</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>2010  2015 &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Marie Gibson<br>2016 &nbsp;-&nbsp;&nbsp;2017 &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Corralie Costigan<br>2017 -&nbsp;&nbsp;2018 &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Ken Burnes<br>2018 -&nbsp;&nbsp;2019 &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Larry Thomson<br>2020 -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Bob Passmore</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>In 2006 Albert Schimmel started a website to promote jazz music featuring the Jazz Program on 4TTT Radio and the NQ Jazz Club. &nbsp;This website is still being managed by Albert with regular updates to the Program page and a selection of photos taken at almost every jazz night each year. &nbsp;This facility has continued to be a great promotional tool for the club with traffic increasing every year.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The committee of 2008 introduced some feature nights to give members a selling point to entice new people to attend in an effort to increase attendance numbers that had been dwindling for a few years. &nbsp;The first of these special evenings would be held close to ANZAC Day featuring music from the war era and a jazz ball with Stokes Nicholson Big Band as the drawcard. &nbsp;Pacific Mainstream Jazz Band offered to present the ANZAC-themed night and a very successful&nbsp;<em>Come in Spinner</em>&nbsp;night with 93 attending was held on 27th&nbsp;April. &nbsp;<em>Cinderellas Jazz Ball</em>&nbsp;was held on 13th&nbsp;September, the name reflecting that this was a mini-ball and guests would all be home before midnight! &nbsp;This was a way to hold a shorter-duration ball at a lower, more competitive ticket price than other balls then being held in Townsville. &nbsp;The night was a huge success with 103 people in attendance!</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Up until this year a different band played at each jazz gig but as musicians moved away from Townsville, drifted to other more lucrative styles of music or retired from playing in bands the club constantly struggled to set a program in advance, not knowing which band would be available. This was not popular with patrons as the club had some members who liked to follow their preferred style of jazz or their band and this uncertainty further depleted crowd numbers. &nbsp;In April the committee decided to introduce the stability of having the same band play on one of the two jazz nights each month and rotate bands in the other jazz night of each month. &nbsp;Pacific Mainstream Jazz Band was appointed as the first house band and a new program had other bands playing on the 2nd&nbsp;Sunday of the month and PMJB regularly on the 4th&nbsp;Sunday. &nbsp;This greatly relieved the pressure on the committee, enabled program information to be publicised in advance through the monthly newsletter and attendances began to increase.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>With the change of venue in 2009 the club made a concerted effort to attract a wider circle of people to the club, predominantly by encouraging all members to introduce at least two new people to the club in that year. &nbsp;This was another successful attempt by the committee to revive the jazz club and with provided the momentum for other ventures such as the Step OUT-Step UP program designed to give emerging jazz enthusiasts the training and mentorship to step out of the classroom and up onto the stage. &nbsp;&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The club continued to hold an annual jazz ball with a change of title to Jazz n Jewels Ball (later changed to Jazz &amp; Jewels Ball) giving patrons the opportunity to dress in their finery and skim the dance floor to the beautiful music of the 22-piece Stokes Nicholson Big Band and a special night close to ANZAC Day to commemorate the post-war era of jazz. &nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>TOWNSVILLE JAZZ CLUB INC.</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The Townsville Jazz Club was originally established as the NQ Jazz Club and operated under this name for approximately 18 years when the management committee began to question whether the regional name of North Queensland that did not clearly inform people where the jazz club was actually based was not assisting new people to locate the club. &nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>In this age of electronic searches to find recreational activities, it was felt that most new residents and people travelling through Townsville who were searching for jazz venues would include&nbsp;<em>jazz</em>&nbsp;and&nbsp;<em>Townsville&nbsp;</em>in their search regardless of any other keywords that they may use in their search. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>At the 2011 Annual General Meeting a proposal was made to change the name of the club to Townsville Jazz Club Inc. to better reflect the physical location of the club. This motion was passed and the official change of name took place on 11 January 2012.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>2012  A year of change and growth</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The clubs website that had been operating since 2006 was changed to reflect the new name and a Townsville Jazz Club Inc. facebook page was established on 21 January 2012.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>On Sunday 24th&nbsp;June 2012 more than half the clubs members were present for the launch of the new Townsville Jazz Club Inc. logo featuring Neville Minon. &nbsp;This was a memorable night when we paid tribute to Nev for his 62 years of service to both jazz and brass band music. &nbsp;With such a distinguished musical career I dont think anyone would begrudge Nev the honour of gracing the Townsville Jazz Club logo. &nbsp;It was clear that Nev was very touched by the occasion and he and his wife Christine were delighted with the image that was created through Bob Spillanes photography and the artistry of Katrina Cataldo at Townprint. &nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>By the time of the AGM in November 2012 the club had increased its non-member attendance by 69% over the previous year which the committee agreed was heavily influenced by the combination of the change of name and a concerted effort to promote the club through electronic media.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The Townsville Jazz Club has continued to shape its program to reflect the style of jazz that attracts the majority of its members (mostly swing and trad jazz), lots of theme nights with patrons encouraged to dress in the fashions of that era, with occasional evenings of modern jazz. &nbsp;The club still encourages bands to play jazz that people can dance to as the most of the members either like to dance or are happy to watch other people dancing whilst still enjoying the music from their chair. &nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>A further development for the club was the introduction of a Facebook page in 2013. This has been steadily expanding peoples awareness of the Townsville Jazz Club and has helped to encourage new people to attend. &nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>As we begin the 2015 jazz year with the Opening Night being held on 8th&nbsp;February, the Townsville Jazz Club has a well-planned program for the year, a hard-working dedicated committee and a membership base that loves jazz and fully support their local musicians. &nbsp;What more could a club want...</p>\n<!-- /wp:paragraph -->',
